CREATE TABLE `t_biz_order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `customerId` varchar(50) NOT NULL,
  `bizOrderNo` varchar(50) NOT NULL,
  `productId` varchar(50) NOT NULL,
  `productName` varchar(200) DEFAULT NULL,
  `docId` varchar(50) DEFAULT NULL,
  `amount` bigint(20) NOT NULL COMMENT '产品的价格',
  `productType` varchar(45) NOT NULL,
  `serviceLength` int(11) NOT NULL,
  `serviceLengthUnit` tinyint(4) NOT NULL COMMENT ' HOUR(2, "HOUR"),\n    DAY(4, "DAY"),\n    MONTH(6, "MONTH"),',
  `orderStatus` tinyint(6) NOT NULL DEFAULT '1' COMMENT 'SAVED(1, "已保存"),\n    /**\n     * 支付\n     */\n    PAY_START(2, "开始支付"),\n    PAYING(3, "支付中"),\n    PAY_SUCCESSED(8, "支付成功"),\n    PAY_FAILED(4, "支付失败"),\n    /**\n     * 服务\n     */\n    IN_SERVICE(9, "订单有效"),\n    SERVICE_END(11, "订单服务终止"),',
  `firstBillDate` datetime NOT NULL COMMENT '第一个账单日',
  `payAmount` bigint(20) NOT NULL COMMENT '真正支付的价格',
  `currency` varchar(3) NOT NULL,
  `mchId` varchar(45) NOT NULL,
  `channelId` varchar(45) NOT NULL,
  `paySuccessTime` timestamp NULL DEFAULT NULL,
  `invalidBizOrderNo` varchar(50) DEFAULT NULL,
  `remark` varchar(200) DEFAULT NULL,
  `createAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `lastUpdateAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `bizOrderNo_UNIQUE` (`bizOrderNo`),
  UNIQUE KEY `uidx_c_b` (`customerId`,`bizOrderNo`)
) ENGINE=InnoDB AUTO_INCREMENT=190 DEFAULT CHARSET=utf8;
