--
-- Table structure for table `t_pay_product`
--

DROP TABLE IF EXISTS `t_pay_product`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_pay_product` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `productId` varchar(50) NOT NULL,
  `productName` varchar(255) NOT NULL,
  `quantity` int(11) NOT NULL DEFAULT '0' COMMENT '数量，默认是0-无限量。',
  `amount` bigint(20) NOT NULL DEFAULT '0' COMMENT '产品的价格，单位是分',
  `productDescription` varchar(255) DEFAULT NULL COMMENT '产品描述，限制255个字符',
  `productType` tinyint(4) NOT NULL COMMENT '产品类型',
  `productStatus` tinyint(4) NOT NULL DEFAULT '1' COMMENT '产品状态，默认是1-Saved',
  `serviceLength` int(11) NOT NULL DEFAULT '0' COMMENT '服务时长，0-无限',
  `serviceLengthUnit` tinyint(4) NOT NULL DEFAULT '4' COMMENT '2-hour, 4-day, 6-month',
  `supportAutoPay` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否支持autopay, 默认不支持',
  `btPlanId` varchar(20) DEFAULT NULL COMMENT 'BrainTree Planid , 用于 订阅使用',
  `createAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `lastUpdateAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
